import React from 'react';
import BotCollection from './BotCollection';
import YourBotArmy from './YourBotArmy';


const App = () => {
  return (
    <div>
      <h1>THE ROBOT COMPANY</h1>
      <table>
        <tr>
          <td>
            <BotCollection />
          </td>
        </tr>
        <tr>
          <td>
            <YourBotArmy />
          </td>
        </tr>
      </table>
    </div>
  );
};

export default App;
